import React from 'react';
import 'antd/dist/antd.css';
import { Form, Input, Button, Checkbox} from 'antd';
import './custom.css'

export default class App extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
      user: '',
      pass: ''
    };
  }

   layout = {
    labelCol: {
      span: 8,
    },
    wrapperCol: {
      span: 16,
    },
  };
   tailLayout = {
    wrapperCol: {
      offset: 8,
      span: 16,
    },
  };

  tailLayout1 = {
    wrapperCol: {
      offset: 6,
      span: 16,
    },
  };

  onFinish = (values) => {
    console.log('Success:');
  };

  onClick = (ttt) => {
    console.log('EIEI:');
    console.log(this.state.user);
    console.log(ttt);
  };


  onFinishFailed = (errorInfo) => {
    console.log('Failed:');
  };

  handleChange = (e) => {
    this.setState({user:e.target.value})
  };

  render() {
    return (
      <div class='centered'>
        <Form {...this.layout} name="basic" initialValues={{ remember: true }} onFinish={this.onFinish} onFinishFailed={this.onFinishFailed}>
          <Form.Item label="Username" name="username" rules={[{ required: true, message: 'Please input your username!' }]} >
            <Input />
          </Form.Item>

          <Form.Item  label="Password"  name="password" rules={[{ required: true, message: 'Please input your password!' }]} >
            <Input.Password />
          </Form.Item>

          <Form.Item {...this.tailLayout} name="remember" valuePropName="checked">
            <Checkbox>Remember me</Checkbox>
          </Form.Item>

          <Form.Item {...this.tailLayout1}>
            <div>
              <Button onClick = {() => this.onClick("TTT")} style = {{ width: '10vh'}} type="primary" >
                Submit
              </Button>
              &nbsp;
              &nbsp;
              &nbsp;
              <Button style = {{ width: '10vh'}} type="primary" >
                Submit
              </Button>
            </div>

          </Form.Item>
        </Form>
      </div>

    );
  }
}
